import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter } from "react-router-dom";
import { CookiesProvider } from "react-cookie";
import "./index.css";
import App from "./App";
import Navbar from './components/Navbar';

ReactDOM.render(
	<React.StrictMode>
		<BrowserRouter>
			<CookiesProvider>
				<Navbar />
				<App />
			</CookiesProvider>
		</BrowserRouter>
	</React.StrictMode>,
	document.getElementById("root")
);
